import { Component, OnInit, Pipe, PipeTransform } from '@angular/core';
import { product } from './product.model';
import { HttpClient } from '@angular/common/http';
import {Tags} from "../models/tags.model";

@Pipe({name: 'enumToArray'})
export class EnumToArrayPipe implements PipeTransform {
  transform(value: any): [number, string][] {
    return Object.keys(value).filter(t => isNaN(+t)).map(t => [value[t], t]);
  }
}

@Component({
  selector: 'app-search',
  templateUrl: './search.component.html',
  styleUrls: ['./search.component.scss'],
})
export class SearchComponent implements OnInit {

  searchQuery: string = '';
  searchUrl: string = "http://localhost:8080/search"

  sellingItems: product[] = [{
    name: 'awesome t-shirt',
    colors: ['red'],
    description: 'very very awesome t-shirt',
    image:'src',
    quantity: 10,
    sellersShop: {},
    creationDate: new Date(),
},
{
    name: 'not awesome jeans',
    colors: ['red'],
    description: 'very very not awesome jeans',
    image:'src',
    quantity: 5,
    sellersShop: {},
    creationDate: new Date(),
}];

colors: string[] = ["red","white", "blue", "green", "black", "yellow"];

Tags = Tags;
selectedOptionsTags:Tags[] = [];
selectedColors:string[] = ["black"];
products: product[] = [];

constructor(private http: HttpClient) { }

  ngOnInit(): void {
  }

  search(){
    this.http.post<product[]>(this.searchUrl, this.searchQuery).subscribe(
      data => {
        console.log(data);
        this.products = data;
      },
      error => {
        console.error('Error searching products:', error);
      }
    );
  }


  toggleSelection(value: Tags) {
    const index = this.selectedOptionsTags.indexOf(value);
    if (index > -1) {
      this.selectedOptionsTags.splice(index, 1);
    } else {
      this.selectedOptionsTags.push(value);
    }
  }

  toggleSelectionColors(value: string) {
    const index = this.selectedColors.indexOf(value);
    if (index > -1) {
      this.selectedColors.splice(index, 1);
    } else {
      this.selectedColors.push(value);
    }
  }
}
<!-- Load icon library -->
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">

<!-- The form -->

<form class="example" action="action_page.php">
  <input type="text" placeholder="Search.." name="search" [(ngModel)]="searchQuery">
  <ng-select [multiple]="true" class="custom"  placeholder="filter">
    <ng-option *ngFor="let option of Tags | enumToArray; let i = index" [value]="option">
    {{option}}
  </ng-option>
  </ng-select>
<br>
<br>
<br>
  <ng-select [multiple]="true"   placeholder="color">
    <ng-option *ngFor="let option of colors; let i = index" [value]="option">
      {{option}}
  </ng-option>
  </ng-select>
<br/>Selected: {{selectedColors | json}}

<br>
  <button type="submit"  (click)="search()"><i class="fa fa-search"></i></button>
</form>

<ul>
  <li *ngFor="let product of products">
    <div class="card">
      <img src="data:image/jpeg;base64," alt="Avatar" style="width:100%">
      <div class="container">
        <h4><b>{{ product.name }}</b></h4>
        <p>{{product.description}}</p>
      </div>
    </div>
  </li>
</ul>
